app.controller('BillingController', function($scope, LoadProduct, Checkout, CreditorInfo, CreditorAdd, SharedResources) {

	$scope.cart = [];
	$scope.product_id = '';
	$scope.creditor_id = '';
	$scope.product_name = '';
	$scope.qty = 0;
	$scope.total_bill = 0;
	$scope.hiddenOrNot = 'hidden';
	$scope.selected_tr = '';
	$scope.selectedRow = null;
	$scope.activeEditID = null;
	$scope.product_id_modal = '';
	$scope.qty_modal = null;
	$scope.allProducts = null;
	$scope.clicked = false;
	$scope.creditors = null;
	$scope.creditorName = '';
	$scope.address = '';
	$scope.contact = '';
	$scope.email = '';
	$scope.dueDate = new Date();
	$scope.notification = [];
	$scope.notifcounter = 'No notifications yet';
	$scope.tender_amount = 0;
	$scope.total_return = $scope.tender_amount - $scope.total_bill;

	$scope.$watch('tender_amount', function() {
		$scope.total_return = $scope.tender_amount - $scope.total_bill;
	})

	var warehouse = LoadProduct.getAll();

	var creditors = CreditorInfo.get();

	warehouse.then( function ( result ) {
		$scope.allProducts = result;
		console.log($scope.allProducts);
		SharedResources.setResource( { resName: 'PRODUCTS', data: result } );
	});

	creditors.then( function ( result ) {
		$scope.creditors = result;
		console.log($scope.creditors);
	});

	$scope.hideModalAndShowCreditPurchaseModal = function () {
		$('.new-creditor-modal').modal( 'hide' );
		$('.credit-purchase-modal').modal( 'show' );
	}

	$scope.testone = function() {

		console.log('test pass');
		$scope.selectedRow = null;
		// $scope.activeEditID = null;
	}

	$scope.addToCart = function() {

		// valdation ko kaam baki cha. ani printer ko



		for (var i = $scope.allProducts.length - 1; i >= 0; i--) {

			if( $scope.allProducts[i].p_id == $scope.product_id.split(' ')[0] ) {
				if( $scope.allProducts[i].p_count < $scope.qty ) {
					console.log( 'Only '+ $scope.allProducts[i].p_count +' units in stock.'  );
					$scope.notification.push( 'Only '+ $scope.allProducts[i].p_count +' units in stock.' );

					if( typeof( $scope.notifcounter ) == 'string' ) {
						$scope.notifcounter = 1;
					}

					else {
						$scope.notifcounter += 1;
					}

					return false;
				}

				$scope.allProducts[i].p_count = $scope.allProducts[i].p_count - $scope.qty;
				// $scope.

			}

		};

		var existing_flag = false;
		var index = 0;

		$scope.selectedRow = null;

		document.getElementById('edit-item').setAttribute('hidden', null);
		document.getElementById('delete-item').setAttribute('hidden', null);

		var product_details = $scope.product_id.split(' ');
		var product_name = '';

		for (var i = 1; i < product_details.length; i++ ) {
			product_name = product_name + " " + product_details[i];
		};

		if ( $scope.cart.length > 0 ) {
			for (var i = $scope.cart.length - 1; i >= 0; i--) {
				if( $scope.cart[i].item === product_details[0] ) {
					existing_flag = true;
					index = i;
					break;
				}
				else { existing_flag = false; }
			};
		}

		if( existing_flag ) {
			$scope.updateCart(index);
		}
		else {
			$scope.createNewCartContent();
		}
	}

	$scope.updateTotalBill = function () {
		$scope.total_bill = 0;
		for (var i = $scope.cart.length - 1; i >= 0; i--) {
			$scope.total_bill += $scope.cart[i].qty * $scope.cart[i].unit_price;
		};

		if( $scope.total_bill > 0 ) {
			$scope.hiddenOrNot = '';
		}
		console.log( $scope.total_bill );
		console.log( $scope.cart );
	}

	$scope.createNewCartContent = function() {
		console.log('New Cart Item');
		var product_details = $scope.product_id.split(' ');
		var product_name = '';
		var selling_price = $('#'+ product_details[0]).attr( 'selling-price' );

		for (var i = 1; i < product_details.length; i++ ) {
			product_name = product_name + " " + product_details[i];
		};

		$scope.cart.push( {item: product_details[0], name: product_name, qty: $scope.qty, unit_price: selling_price, tax: null} );
		console.log( $scope.cart );

		$scope.updateTotalBill();

		console.log($scope.cart);
	}

	$scope.updateCart = function( index ) {
		$scope.cart[index].qty += $scope.qty;
		$scope.total_bill = 0;

		$scope.updateTotalBill();
	}

	$scope.setSelected = function( row, elem ) {
		$scope.selectedRow = row;
		$scope.activeEditID = elem.item.item;
		$scope.showEditActions();
		event.stopPropagation();
	}

	$scope.showEditActions = function () {
		if( $scope.selectedRow == null ) {
			console.log('not');
			return 0;
		}
		else {
			if( $scope.selectedRow != null ) {
				document.getElementById('edit-item').removeAttribute('hidden');
				document.getElementById('delete-item').removeAttribute('hidden');
			}
		}
	}

	$scope.showBill = function ( cart, applied_schemes ) {
		var bill_total = 0;
		var height = 60 + ( (5 * cart.length) + (5 * applied_schemes.length) );
		var pdf_bill = new jsPDF( 'p', 'mm', [ 100, height ] );
		var i = 1;
		var schemesInEffect = [];

		var logoData = "data:image/jpeg;base64,";

		pdf_bill.setFontSize(7);
		pdf_bill.addImage(logoData, 20, 5, 15, 15);
		pdf_bill.text( 35, 15, 'R-CUBE Department Store' );

		pdf_bill.text( 15, 10+20, "Item" );
		pdf_bill.text( 55, 10+20, "Qty" );
		pdf_bill.text( 65, 10+20, "Rate" );
		pdf_bill.text( 75, 10+20, "Total" );

		pdf_bill.line( 15, 12+20, 80, 12+20 );

		pdf_bill.text( 15, 15+20, cart[0].name );
		pdf_bill.text( 55, 15+20, ""+ cart[0].qty );
		pdf_bill.text( 65, 15+20, ""+ parseInt(cart[0].unit_price ));
		pdf_bill.text( 75, 15+20, ""+ parseInt(cart[0].unit_price) * cart[0].qty );

		bill_total += parseInt(cart[0].unit_price) * cart[0].qty;

		for (i = 1; i < cart.length; i++) {
			pdf_bill.text( 15, 15+20 + (5 * i), cart[i].name );
			pdf_bill.text( 55, 15+20 + (5 * i), ""+ cart[i].qty );
			pdf_bill.text( 65, 15+20 + (5 * i), ""+ parseInt(cart[i].unit_price ));
			pdf_bill.text( 75, 15+20 + (5 * i), ""+ parseInt(cart[i].unit_price) * cart[i].qty );
			bill_total = bill_total + ( parseInt( cart[i].unit_price) * cart[i].qty );
		}

		pdf_bill.line( 65, 17+20 + ( 5 * i ), 80, 17+20 + ( 5 * i ) );
		pdf_bill.text( 65, 20+20 + ( 5 * i ), "Total  :   "+ bill_total );
		pdf_bill.text( 65, 25+20 + ( 5 * i ), "Tender  :   "+ $scope.tender_amount );
		pdf_bill.text( 65, 30+20 + ( 5 * i ), "Return  :   "+ (parseInt($scope.tender_amount) - bill_total ) );


		pdf_bill.line( 65, 32+20 + ( 5 * i ), 80, 32+20 + ( 5 * i ) );
		pdf_bill.line( 65, 33+20 + ( 5 * i ), 80, 33+20 + ( 5 * i ) );

		pdf_bill.text( 65, 40+20 + ( 5 * i ), "Billed by: "+ localStorage.getItem( 'u_name' ) );
		pdf_bill.text( 65, 45+20 + ( 5 * i ), (new Date()).toString().split(' ').splice(1,3).join(' ') );

		pdf_bill.line( 15, 50+20 + ( 5 * i ), 80, 50+20 + ( 5 * i ) );

		pdf_bill.text( 20, 55+20 + ( 5 * i ), "Contact: 01 44556678" );
		pdf_bill.text( 20, 60+20 + ( 5 * i ), "Developer: letters.prasai@hotmail.com" );

		pdf_bill.output( 'dataurlnewwindow' );
		// pdf_example.output( 'dataurlnewwindow' );
	}

	$scope.checkout = function ( creditflag, dueDate ) {

		// console.log( $('#creditor_id').val() );

		var applicable_items = [];
		var applied_items = [];
		var schemes = SharedResources.getResource( 'SCHEMES' );

		for (var i = schemes.length - 1; i >= 0; i--) {
			if( schemes[i].sch_daily_start_time != null && schemes[i].sch_daily_end_time != null  ) {
				var time = (new Date()).toString().split(' ')[4].split(':');
				var schStartTime = schemes[i].sch_daily_start_time.split(':');
				var schEndTime = schemes[i].sch_daily_end_time.split(':');

				if ( schStartTime[0] <= time[0] && time[0] <= schEndTime[0] ) {
					applicable_items.push( schemes[i] );
				}
				else {
					console.log( schemes[i].sch_title +' Not applicable');
				}

				console.log( applicable_items );
			}
			else {
				applicable_items.push( schemes[i] );
			}
		};

		var p_id, c_id;

		for (var i = $scope.cart.length - 1; i >= 0; i--) {
			c_id = $scope.cart[i].item.split('P')[0];
			p_id = $scope.cart[i].item;

			console.log( c_id );
			console.log( p_id );

			for (var j = applicable_items.length - 1; j >= 0; j--) {
				console.log( applicable_items[j].c_id == null ? applicable_items[j].p_id : applicable_items[j].c_id );
				if( applicable_items[j].p_id == p_id || applicable_items[j].c_id == c_id ) {
					console.log( 'Applicable on '+ $scope.cart[i].item );
					if( applicable_items[j].sch_type == "DISCOUNT" ) {
						console.log("DISCOUNT");
						if( applicable_items[j].sch_unit == "%" ) {
							console.log("%");
							$scope.cart[i].unit_price =  $scope.cart[i].unit_price - ($scope.cart[i].unit_price * (applicable_items[j].sch_amt/100));
							console.log( $scope.cart[i] );
							applied_items.push( applicable_items[j].sch_title );
						}
						if( applicable_items[j].sch_unit == "NRS" ) {
							console.log("NRS");
							$scope.cart[i].unit_price = $scope.cart[i].unit_price - applicable_items[j].sch_amt;
							applied_items.push( applicable_items[j].sch_title );
						}
					}

					if( applicable_items[j].sch_type == "TAX" ) {
						if( applicable_items[j].sch_unit == "%" ) {
							$scope.cart[i].tax = applicable_items[j].sch_amt;
							applied_items.push( applicable_items[j].sch_title );
						}
					}
				}
			};

		};

		console.log( $scope.cart );

		Checkout.process( $scope.cart, creditflag, $scope.dueDate, $('#creditor_id').val() );

		$scope.showBill( $scope.cart, applied_items );

		$scope.cart = [];
		$scope.product_id = '';
		$scope.creditor_id = '';
		$scope.product_name = '';
		$scope.qty = 0;
		$scope.total_bill = 0;
		$scope.hiddenOrNot = 'hidden';
		$scope.selected_tr = '';

		console.log( $scope.allProducts );

		$scope.hideModal();



	}

	$scope.newCreditor = function () {
		$('.credit-purchase-modal').modal( 'hide' );
		$('.new-creditor-modal').modal( 'show' );
	}

	$scope.addNewCreditor = function () {
		CreditorAdd.process( $scope.creditorName, $scope.address, $scope.contact, $scope.email );
	}

	$scope.hideModal = function () {
		console.log('Modal Hide');
		$('.delete-modal').modal( 'hide' );
		$('.edit-modal').modal( 'hide' );
		$('.credit-purchase-modal').modal( 'hide' );
		$('.new-creditor-modal').modal( 'hide' );
	}

	$scope.validateAndEdit = function () {

		if( $scope.product_id_modal == "" || $scope.qty_modal == "" || $scope.qty_modal == null ) {
			console.log("Not Allowed");
		}

		else {
			console.log($scope.product_id_modal);

			var product_details = $scope.product_id_modal.split(' ');
			var product_name = '';

			for (var i = 1; i < product_details.length; i++ ) {
				product_name = product_name + " " + product_details[i];
			};

			for (var i = $scope.cart.length - 1; i >= 0; i--) {
				if( $scope.cart[i].item === product_details[0] ) {
					console.log('yo');
					$scope.cart[i].qty = $scope.qty_modal;
					break;
				}
			};

		$('.edit-modal').modal( 'hide' );
		$scope.updateTotalBill();
		}
	}

	$scope.deleteEntry = function ( elem ) {
		var item_pr = 0, item_qty = 0;
		console.log( $scope.activeEditID );
		for (var i = $scope.cart.length - 1; i >= 0; i--) {
			if( $scope.cart[i].item === $scope.activeEditID ) {
				console.log( 'in deleteEntry' );
				item_pr = $scope.cart[i].unite_price;
				item_qty = $scope.cart[i].qty;
				$scope.cart.splice( i, 1 );
				break;
			}
		};

		$('.delete-modal').modal('hide');
		$('.selected').html('');
		$scope.total_bill -= item_pr * item_qty;
		$scope.updateTotalBill();
	}
});